Description:
A lava lake with narrow paths, fire traps and a deep fog. Also lots of archers.
If you don't want to kill all enemies, you can parkour up the closer monument and press a button there to drown enemies in lava!
Difficulties: 1 bronze, 1 silver, 1 gold, 1 diamond.

If this is too easy for you, checkout [url=https://steamcommunity.com/sharedfiles/filedetails/?id=1795698210]the harder version[/url].
Also, checkout the [url=https://steamcommunity.com/sharedfiles/filedetails/?id=2339113292]challenge version[/url].

